import './App.css';
import Product from './Product';





function App() {
  return (
    <div className="App">

   {phoneData.map((phone,id) =>{
    <Product key={id}
      name={phone.name}
      price={phone.price}
      diskon={phone.diskon}

    ></Product>
   })}

    </div>
  );
}

export default App;
